import React,{Component} from 'react';
import {HomeWrapper,
        HomeLeft,
        HomeRight,
    } from './style';
import List from './components'
class Home extends Component{
    render(){
        return (
            <HomeWrapper>
                <HomeLeft>
                    <img className="banner-img" src="//upload.jianshu.io/admin_banners/web_images/4606/5d7f5855af24cb8cd161f37d9f9af47342714f34.jpg?imageMogr2/auto-orient/strip|imageView2/1/w/1250/h/540"></img>
               <List/>
                </HomeLeft>

                <HomeRight>

                </HomeRight>
            </HomeWrapper>
        )
    }
}

export default Home;
